column8:
■通常時に充電を行い、停電時には自動的に点灯。75個の高輝度LEDライトを使用しています。<br> 
■バッテリー内臓<br>
　定格容量600mAh、メンテナンスフリーのバッテリーを内蔵<br>
■高輝度ＬＥＤ75個<br>
　75個の長寿命な高輝度SMD白色LED電球を使用。停電時でも高い輝度を保ちます。<br>
■500回充電可能<br>
　充電回数500回可能。安心・長持ちのロングライフ設計です。<br>
■約8～14時間点灯<br>
　”LOW”で使用した場合、消費電力はわずか5.4W。約14時間点灯できます。<br>
■全光束900lm<br>
■High-Low光量切替<br>
■持ち運び用ハンドル付き<br>
<br>
<font size="2">
【仕　様】<br>
定格入力電圧：AC100～240V　50/60Hz<br>
定格入力電流：20mA<br>
定格出力電源：5.4W<br>
バッテリー部：6000mAh鉛蓄電池<br>
再充電時間：約12時間<br>
ライト部：75個LED使用<br>
全光束：900lm<br>
ライト点灯継続時間：約8～14時間<br>
サイズ：Ｗ/約39.5×Ｈ/約9.3×Ｄ/約6cm<br>
